import props from "../data/data"
import RealEstat from "./real-estat"
const Home = () => (
    <div className="proportes">{
        
    props.map(item=>{
        return(
            <div className="item" >
        <RealEstat key={item.id} item={item}></RealEstat>
           
           </div>
            )
    })}
     <style jsx>{`
                
                  .flex-items{
                  display: flex;
                  flex-direction: row;
                  flex-wrap: wrap;
                  justify-content: space-around;
                  max-height: 100vh;
                  width:100%
                  }
                  .item{
                    width:25%
                  }
                  
                  @media only screen and (max-width: 700px) {
                    .main-flex{
                      width: 100%;
                      display: flex;
                      flex-direction: column;
                  
                    }
                  
                    .flexitems{
                      max-width: 99vw;
                      min-width: 99vw;
                  
                    }
                    .search-container{
                      min-width: 50%;
                      max-width: auto;
                      display: flex;
                      flex-direction: row;
                      justify-content: space-around;
                      margin-right: auto;
                      margin-left: auto;
                    }
                    app-search{
                      width: 100%;
                    float: right;
                    }
                    .container{
                      margin-top: 0;
                    }
                  }
                  @media only screen and (max-width: 700px) {
                    .filters{
                      font-size: 1vw;
                    }
                  .item{
                    width: 45%;
                    margin-left: 2%;
                  }
                  
                  }
                  @media only screen and (min-width: 2000px) {
                  
                    .item{
                      width: 350px !important;
                      margin-left: 2%;
                    }
                  
                    }
                  
                  
                  
                
                ` }
                
            </style>
    </div>
)

   
  export default Home;
